window.bookSummaryJSON = "<p>Wes Silver wasn’t looking for love, but when July Mayson literally knocks him on his ass during their first encounter, his world is turned upside down by the quirky blonde, and every moment with her makes him more determined to protect her. </p> <p>July Mayson doesn’t understand the pull she feels toward bad-boy biker Wes Silver, but she knows being with him is like nothing she’s ever felt before. Now all she has to do is tell her overprotective father, Asher Mayson, that she’s found her boom.</p>"; 
